INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 7001, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 7, -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 7002, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 7, -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 7003, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 7, -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 10001, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 10, -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 10002, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 10, -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 10003, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 10, -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 10004, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 10, -363.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 12001, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 12, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 13001, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 13, -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 13002, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 13, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 13003, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 13, -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 13004, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 13, -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 14001, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 14, -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 14002, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 14, -363.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 14003, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 14, -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 14004, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 14, -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 15001, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 15, -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 16001, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 16, -363.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 16002, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 16, -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 16003, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 16, -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 16004, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 16, -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 17002, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 17, -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 17004, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 25, -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 17005, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 25, -363.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 17006, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 25, -363.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 17007, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 25, -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 18001, 0, 0.0, "2015/12/17 15:00:00", 190801, 1, 0.0, "カリン", 18, -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 18002, 0, 0.0, "2015/12/17 15:00:00", 190801, 2, 0.0, "カリン", 18, -363.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 19001, 0, 0.0, "2015/12/17 15:00:00", 190801, 3, 0.0, "カリン", 19, -470.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 19002, 0, 0.0, "2015/12/17 15:00:00", 190801, 4, 0.0, "カリン", 19, -470.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 20001, 0, 0.0, "2015/12/17 15:00:00", 190801, 5, 0.0, "カリン", 20, -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 20002, 0, 0.0, "2015/12/17 15:00:00", 190801, 6, 0.0, "カリン", 20, -470.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 21001, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 21, -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 21002, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 21, -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 21003, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 21, -363.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 21004, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 21, -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 22001, 0, 0.0, "2015/12/17 15:00:00", 190801, 1, 0.0, "カリン", 22, -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 22002, 0, 0.0, "2015/12/17 15:00:00", 190801, 2, 0.0, "カリン", 22, -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 23001, 0, 0.0, "2015/12/17 15:00:00", 190801, 3, 0.0, "カリン", 23, -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 23002, 0, 0.0, "2015/12/17 15:00:00", 190801, 4, 0.0, "カリン", 23, -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24001, 10011, 4.08, "2019/01/31 12:00:00", 109001, 1, 8.0, "エリコ（バレンタイン）", 24, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24002, 10011, 5.0, "2019/01/31 12:00:00", 109001, 2, 8.0, "エリコ（バレンタイン）", 24, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24003, 10011, 10.11, "2019/01/31 12:00:00", 109001, 3, 8.0, "エリコ（バレンタイン）", 24, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24004, 10011, 4.0, "2019/01/31 12:00:00", 109001, 4, 8.0, "エリコ（バレンタイン）", 24, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24005, 10011, 6.0, "2019/01/31 12:00:00", 109001, 5, 8.0, "エリコ（バレンタイン）", 24, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24006, 10011, 0.0, "2019/01/31 12:00:00", 109002, 6, 0.0, "エリコ（バレンタイン）", 24, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24007, 10011, 0.0, "2019/01/31 12:00:00", 109002, 7, 0.0, "エリコ（バレンタイン）", 24, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24008, 10011, 0.0, "2019/01/31 12:00:00", 109002, 8, 0.0, "エリコ（バレンタイン）", 24, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24009, 10011, 0.0, "2019/01/31 12:00:00", 109002, 9, 0.0, "エリコ（バレンタイン）", 24, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24010, 10011, 0.0, "2019/01/31 12:00:00", 109002, 10, 0.0, "エリコ（バレンタイン）", 24, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24011, 10011, 2.12, "2019/01/31 12:00:00", 109101, 1, 8.0, "シズル（バレンタイン）", 24, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24012, 10011, 4.19, "2019/01/31 12:00:00", 109101, 2, 8.0, "シズル（バレンタイン）", 24, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24013, 10011, 2.3, "2019/01/31 12:00:00", 109101, 3, 8.0, "シズル（バレンタイン）", 24, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24014, 10011, 0.0, "2019/01/31 12:00:00", 109102, 4, 0.0, "シズル（バレンタイン）", 24, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24015, 10011, 5.23, "2019/01/31 12:00:00", 109101, 5, 8.0, "シズル（バレンタイン）", 24, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24016, 10011, 0.0, "2019/01/31 12:00:00", 109102, 6, 0.0, "シズル（バレンタイン）", 24, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24017, 10011, 5.01, "2019/01/31 12:00:00", 109101, 7, 8.0, "シズル（バレンタイン）", 24, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24018, 10011, 0.0, "2019/01/31 12:00:00", 109102, 8, 0.0, "シズル（バレンタイン）", 24, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24019, 10011, 0.0, "2019/01/31 12:00:00", 109102, 9, 0.0, "シズル（バレンタイン）", 24, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 24020, 10011, 0.0, "2019/01/31 12:00:00", 109102, 10, 0.0, "シズル（バレンタイン）", 24, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 26001, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 26, -363.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 26002, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 26, -363.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 26003, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 26, -363.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 26004, 0, 0.0, "2015/12/17 15:00:00", 105901, 1, 0.0, "コッコロ", 26, -363.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (2104010, 27001, 0, 0.0, "2015/12/17 15:00:00", 106401, 1, 0.0, "シェフィ", 27, -363.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 27002, 0, 0.0, "2015/12/17 15:00:00", 105801, 1, 0.0, "ペコリーヌ", 27, -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 27003, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 27, -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, 1, "2030/12/17 14:59:59");
