INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 43003, 0, 0.0, "2015/12/17 15:00:00", 106001, 1, 0.0, "キャル", 43, -363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 1, "2030/12/17 14:59:59");
